// A huffmanTree describes the code tree of a Huffman code table. It's just a
// flat slice of integers whose contents is logically organized in pairs, each
// pair representing a node in the tree. For leaf nodes, the first number is
// zero, and the second one is the value assinged to that node. For internal
// nodes, the numbers are the indexes of the two child nodes. The root node is
// at index 0.
type huffmanTree []uint32

// huffmanTrees lists the code tables used for coding the big_values region
// (Table 3-B.7) and is indexed with the value of the table_select field. Tables
// 4 and 14 are marked as "not used" in the standard, so these entries are nil.
// So is table 0, as it only contains a single zero-length code word.
//
// hlen, x, and y are all packed in a single integer according to the following
// bitmap:
//
//   -------- xxxxxxxx -------- --------  hlen + # of sign bits
//   -------- -------- xxxxxxxx --------  x
//   -------- -------- -------- xxxxxxxx  y
var huffmanTrees = [32]huffmanTree{
	    nil, htree01, htree02, htree03,     nil, htree05, htree06, htree07,
	htree08, htree09, htree10, htree11, htree12, htree13,     nil, htree15,
	htree16, htree16, htree16, htree16, htree16, htree16, htree16, htree16,
	htree24, htree24, htree24, htree24, htree24, htree24, htree24, htree24,
}

